import {  AfterViewChecked,  ChangeDetectorRef, Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { DateUtilsService } from 'app/core/util/date-utils.service';


@Component({
  selector: 'n2-view-supporting-doc',
  templateUrl: './view-supporting-doc.component.html',
  styleUrls: ['./view-supporting-doc.component.scss']
})
export class ViewSupportingDocComponent implements OnInit, AfterViewChecked {

  params: any;

  constructor(
    private route: ActivatedRoute,
    public dateUtilsService: DateUtilsService,
    private cd: ChangeDetectorRef
  ) { 
  }
  ngAfterViewChecked(): void {

    this.cd.detectChanges();
  }

  ngOnInit(): void {
    this.route.queryParams.subscribe((params) => {
      this.params = params;
    });
  }
}

<div class = "grid col-4" [style]="{'margin-bottom':'1em'}">
    <div class = "col">
        NRIC: {{ params.nric }}
    </div>
    <div class = "col">
        Name:  {{ params.name }}
    </div>
    <div class = "col">
        Case ID: {{ params.caseId }}
    </div>
</div>
<n2-claim-supp-doc [params]="this.params"></n2-claim-supp-doc>
